        'mgnl:template': 'packrunweb:components/textImage'
        'text': '<p>Do you have a question about one of our courses? Would you like
          to customize a tour - or looking for a trip you just can&rsquo;t find on
          our website?</p>

          <p>Do you have a question about how our courses work, about a booking you&rsquo;ve
          placed or about payment? Or are you on your trip now and have a question
          or need support?</p>

          <p>Or do you have a media or press query?</p>

          <p>For any of these concerns please contact us via the most convenient method
          below. We are available for you 24/7.</p>

          <p><strong>All inquiries</strong><br /> <a href="mailto:contact@magnolia-packrunwebs-example.com"
          style="text-decoration:none;">contact@magnolia-packrunwebs-example.com</a><br
          /> <a href="tel:+1 800 123 4567">+1 800 123 4567</a></p> '
        'text_de': '<p>Haben Sie Fragen zu einer unserer Reisen? M&ouml;chten Sie
          eine der Reisen auf Ihre pers&ouml;nlichen Bed&uuml;rfnisse zuschneiden
          lassen &ndash; oder sind Sie auf der Suche nach einer Reise, die Sie auf
          unserer Webseite nicht gefunden haben?</p>

          <p>Haben Sie eine Frage dazu, wie unsere Reisen durchgef&uuml;hrt werden,
          zu Ihrer Buchung oder den Zahlungsmodalit&auml;ten? Oder befinden Sie sich
          gerade auf einer der Reisen und haben eine Frage dazu oder ben&ouml;tigen
          Unterst&uuml;tzung?<br /> &nbsp;&nbsp; &nbsp;<br /> Oder haben Sie eine
          Medien- oder Presseanfrage?<br /> &nbsp;&nbsp; &nbsp;<br /> F&uuml;r all
          diese Anfragen k&ouml;nnen Sie uns auf die f&uuml;r Sie geeignetste Art,
          wie Sie sie unten sehen, erreichen. Wir stehen Ihnen rund um die Uhr zur
          Verf&uuml;gung.<br /> &nbsp;&nbsp;&nbsp;<br /> <strong>Alle Anfragen</strong><br
          /> <a href="mailto:contact@magnolia-packrunwebs-example.com">contact@magnolia-packrunwebs-example.com</a><br
          /> <a href="tel:+1 800 123 4567">+1 800 123 4567</a></p> '
